import axios from "axios"
import { useEffect, useState } from "react"
import StudentDis from "./StuDisplay"
const Display=()=>{
const [studata,setStudata]=useState([])

const loadData=()=>{
axios.get("http://localhost:8000/studisplay").then((res)=>{
setStudata(res.data)
})    
}

useEffect(()=>{
    loadData()
},[])

const mydata=studata.map((key)=>
<StudentDis
rno={key.name}
nm={key.cname}

/>
)

return(
    <>
    <h1>welcome to display</h1>
    <div style={{display:"flex"}}>
    <div className="display">
    
<table border="1" align="center" width="500px" height="50px" bgcolor="orange">
<tr>
<td>Member Name</td>
<td>Candidate Name</td>

</tr>
{mydata}
</table>
</div>
</div>
    </>
)
}

export default Display
